import "./Cta.css";

export default function Cta() {
  return (
    <section className="cta">
      <h2>Ready to Publish Your Research?</h2>
      <p>
        Submit your manuscript and join a community of leading legal scholars
      </p>
      <button>Submit Your Manuscript</button>
    </section>
  );
}
